import React,{useState} from "react";
import Modal from "react-modal";

const ModalForm = ({ onAfterOpen, onRequestClose }) => {
  const customStyles = {
    content: {
      top: "50%",
      left: "50%",
      right: "auto",
      bottom: "auto",
      marginRight: "-50%",
      transform: "translate(-50%, -50%)",
    },
  };
  return (
    <div>
      {" "}
      <Modal style={customStyles} onAfterOpen onRequestClose isOpen>
        <h2 ref={(_subtitle) => (subtitle = _subtitle)}>Hello</h2>
      </Modal>
    </div>
  );
};

export default ModalForm;
